import DataList from "../DataList";
import SectionCard from "../SectionCard";

const ClienteDashboard = ({ displayName, dashboardData }) => (
  <>
    <SectionCard
      title={`Hola, ${displayName}`}
      description="Selecciona una microempresa para explorar."
    />
    <SectionCard title="Microempresas">
      <DataList
        items={(dashboardData?.microempresas || []).map((item) => ({
          id: item.tenant_id,
          label: item.nombre,
          meta: item.email,
        }))}
        emptyLabel="No hay microempresas registradas."
      />
    </SectionCard>
  </>
);

export default ClienteDashboard;
